*Vaga para estudante de Arquitetura e Urbanismo* 👩🏼‍🎓

O ArqTur está procurando *uma pessoa que seja apaixonada por arquitetura e viagem* 🥰 como a gente pra auxiliar na produção de material gráfico das nossas viagens:
- produção de conteúdo (Feed, Story e Reels) para mídias sociais e site;
- flyers, folders, cartazes e programas de divulgação das viagens;
- guias impressos de cada viagem.
Trabalho home-office ou híbrido, com disponibilidade de 20h por semana, de preferência das 14h às 18h (com flexibilidade, conforme acordado).

*Requisitos:*
Estar cursando Arquitetura e Urbanismo há pelo menos 3 semestres;
Conhecimento intermediário de softwares gráficos como Canva, Photoshop, Illustrator e afins;
Gostar de aprender sobre Arquitetura e Cidades e de compartilhar conhecimento sobre esses temas;
Possuir MEI pra fornecer nota fiscal.

*Diferenciais:*
Possuir portifólio específico de representação, diagramação e trabalhos com produção de material gráfico;
Já ter viajado em um ArqTur por conhecer nosso trabalho;
Ser beneficiário de programas sociais educacionais como FIES ou PROUNI.

*Remuneração:* 800 reais por mês. 💸

*Como se candidatar:* Enviar e-mail para arqtur@volaviagens.com.br com título “Vaga para estudante de Arquitetura e Urbanismo” com texto de motivação de até 700 caracteres no corpo do e-mail e portifólio de trabalhos relacionados em anexo. 
*Inscrições até 5/3/24, entrevistas e início dos trabalhos ainda em março.* 🥰

